	private long func_addr_value;
	private int offset;
	private int size;
	private String file_name;
	private long line_num;
	private String go_version_str;

	FileLine(Address func_addr, int offset, int size, String file_name, long line_num, String go_version_str) {
		this.func_addr_value=func_addr.getOffset();
		this.offset=offset;
		this.size=size;
		this.file_name=file_name;
		this.line_num=line_num;
		this.go_version_str=go_version_str;
	}

	public long get_func_addr() {
		return func_addr_value;
	}

	public int get_offset() {
		return offset;
	}

	public int get_size() {
		return size;
	}

	public String get_file_name() {
		return file_name;
	}

	public long get_line_num() {
		return line_num;
	}

	public String find_matching_filename() {
		if (file_name==null) {
			return null;
		}

		return FILE_NAME_LIST.stream()
			.filter(Objects::nonNull)
			.filter(token -> !token.isEmpty())
			.filter(token ->
				file_name.equals(token)
				|| file_name.endsWith("src/" + token)
				|| file_name.endsWith("src\\" + token)
			)
			.findFirst()
			.orElse(null);
	}

	@Override
	public String toString() {
		String token=find_matching_filename();
		if (token!=null) {
			// Depends on ghidra's comment rules.
			return String.format("{@url https://github.com/golang/go/blob/%s/src/%s#L%d}", go_version_str, token, line_num);
		}
		return String.format("%s:%d", file_name, line_num);
	}
